note_models.css:
.card 
{
  font-family: EPSON 教科書体Ｍ;
  font-size: 20px;
  text-align: left;
  color: black;
  background-color: white;
}

.expression
{
  font-family: EPSON 教科書体Ｍ;
  font-size: 44px;
  color: #000000;
}

.reading
{
  font-family: 'MS PGothic';
  font-size: 24px;
  color: #AA0000;
}

.meaning
{
  font-family: Arial;
  font-size: 16px;
  color: #000000;
}

.sequence_marker
{
  font-family: Arial;
  font-size: 9px;
  color: #000000;
}

.media
{
  font-family: Arial;
  font-size: 12px;
  color: #000000;
}

[mtype=unknown]{
  color: red;
}
[mtype=seen] {
  color: orange;
}
[mtype=known]  {
  color: green;
}
[mtype=mature]{
 color: blue;
}

